const getNewAnimation = (first) => {
    const newAnimation = Math.random() >= 0.5
        ? bloons.bloons[Math.floor(Math.random() * bloons.bloons.length)]
        : bloons.moab[Math.floor(Math.random() * bloons.moab.length)];
    if (first) {
        newAnimation.delay = Math.random();
    } else {
        newAnimation.delay = Math.random() * (6 - 2) + 2;
    }
    newAnimation.duration = 25 / newAnimation.speed;

    return newAnimation;
}

const checkIfAnimExist = (animation, newAnimation) => animation.name === newAnimation.name || animation.delay === newAnimation.delay;

